import React, { Component } from 'react';
import { Table } from 'antd';

class TableEmployer extends Component {

  render() {
    const { data } = this.props
    const columns = [
      {
        title: 'Employer Name',
        dataIndex: 'name',
        render: (text, record) => (
          <h2 className="table-avatar">
            <a href="/admin/profile" className="avatar avatar-sm mr-2"><img alt="" src={`http://excodeteam.com/crs/public/images/${record.photo}`} /></a>
            <a href="/admin/profile">{text}</a>
          </h2>
        ),
      },
      {
        title: 'Email',
        dataIndex: 'email'
      },
      {
        title: 'Mobile',
        dataIndex: 'mobile',
      },
    ]

    return (
      <div>
        <Table className="table-striped"
          style={{ overflowX: 'auto' }}
          columns={columns}
          // bordered
          dataSource={data}
          rowKey={record => record.id}
          pagination={false}
        />
      </div>

    )
  }
};

export default TableEmployer;
